    c = {}
    ans = []
    total = n * n
    nr = 0
    nc = 0
    for i in range(k):
        tim = arr[i]
        if i == 0:
            r[tim[0]] = 1
            c[tim[1]] = 1
            total -= 2 * n - 1
            nr += 1
            nc += -1
            ans.append(total)
        else:
            if tim[0] not in r:
                r[tim[0]] = 1
                total -= n - nc
                nr += 1
            else:
                pass
            if tim[1] not in c:
                c[tim[1]] = 1
                total -= n - nr
                nc += 1
            else:
                pass
            ans.append(total)
    return ans

